import React, { useState, useEffect } from 'react';
import { View, StyleSheet, Text } from 'react-native';
import axios from 'axios';

// Sample component for JSON key 1
const ComponentForJSONKey1 = ({ data }) => {
  return (
    <View style={styles.container}>
      <Text>Component for JSON Key 1</Text>
      <Text>Data: {JSON.stringify(data)}</Text>
    </View>
  );
};

// Sample component for JSON key 2
const ComponentForJSONKey2 = ({ data }) => {
  return (
    <View style={styles.container}>
      <Text>Component for JSON Key 2</Text>
      <Text>Data: {JSON.stringify(data)}</Text>
    </View>
  );
};

const Results = () => {
  const [jsonData, setJsonData] = useState(null);

  useEffect(() => {
    // Importing JSON file from assets (adjust the path as needed)
    const fetchData = async () => {
      try {
        const response = await axios.get('../assets/data.json');
        setJsonData(response.data);
      } catch (error) {
        console.error('Error fetching JSON data:', error);
      }
    };

    fetchData();
  }, []);

  // Function to render components based on JSON keys
  const renderComponents = () => {
    if (!jsonData) {
      return <View style={styles.container}><Text>Loading...</Text></View>;
    }

    // Check keys present in JSON data
    const keys = Object.keys(jsonData);

    if (keys.includes('key1')) {
      // Render components for JSON with 'key1'
      return <ComponentForJSONKey1 data={jsonData.key1} />;
    } else if (keys.includes('key2')) {
      // Render components for JSON with 'key2'
      return <ComponentForJSONKey2 data={jsonData.key2} />;
    } else {
      return <View style={styles.container}><Text>No valid JSON key found</Text></View>;
    }
  };

  return (
    <View style={styles.container}>
      {renderComponents()}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});

export default Results;
